  return (
    <div className="blog-list">
      <p className="blog-title"> {title}</p>
      {blogs.map((blog) => (
        <div className="blog-preview" key={blog.id}>
          <h2>
            {blog.title}
            <p>Written by {blog.author}</p>
          </h2>
          <button onClick={() => {}}>delete blog</button>
        </div>
      ))}
    </div>
  );
};

